import{_ as t,o,c as e,a as r}from"./app.59f33541.js";const s={},n=r('<h1 id="elisabeth-bathory" tabindex="-1"><a class="header-anchor" href="#elisabeth-bathory" aria-hidden="true">#</a> Elisabeth B\xE1thory</h1><h2 id="the-new-elisa" tabindex="-1"><a class="header-anchor" href="#the-new-elisa" aria-hidden="true">#</a> The New Elisa</h2><p><strong>Mash:</strong> Excuse me. An old-fashioned letter arrived addressed to you, Senpai.</p><hr><p><strong>Fujimaru 1:</strong> Huh, read it to me?</p><hr><p><strong>Fujimaru 2:</strong> A letter...arrived here?</p><hr><p><strong>Mash:</strong> Read it to you? All right...Hm. It&#39;s a notice for a concert tour.</p><hr><p><strong>Fujimaru 1:</strong> Concert...Whose?</p><hr><p><strong>Fujimaru 2:</strong> Oh...Right, ignore it.</p><hr><p><strong>Dr. Roman:</strong> What! Who? Who&#39;s coming here? Magi\u2606Mari! Could it be Magi\u2606Mari?</p><p><strong>Dr. Roman:</strong> Oh, has my holy 2D internet idol finally manifested here in the real world?</p><p><strong>Fou:</strong> Fou...</p><p><strong>Mash:</strong> Let&#39;s see, it says the idol is... the super hot Dragon Girl, Idoler\u2606Elisa...</p><p><strong>Dr. Roman:</strong> We&#39;re done. Everyone, great work.</p><p><strong>Mash:</strong> Huh?</p><p><strong>Dr. Roman:</strong> Who cares? Honestly, who cares about a real idol and their scandals?</p><p><strong>Dr. Roman:</strong> It&#39;ll muddy my boyish heart! Those virtual net idols won&#39;t ever betray me.</p><p><strong>Elisabeth:</strong> Here you are, [\u2642 Puppy /\u2640\uFE0F Deerlet}! Did you read my announcement yet? Did you?</p><p><strong>Elisabeth:</strong> Of course you did! What an easy response! And a healthy complexion! Perfect!</p><p><strong>Elisabeth:</strong> All right, then let&#39;s go do it!! Idoler\u2606Elisa, Live Tour 2017</p><p><strong>Elisabeth:</strong> I heard people were already lining up the night before, so you better hurry\u266A Here we go, Chief AD/Sponsor!</p><p><strong>Elisabeth:</strong> Elly Festival IN some time somewhere. Let the Rondo of Blood begin!</p><p><strong>Mash:</strong> Ah, Senpai! What does she mean by sponsor?</p><p><strong>Fou:</strong> Fou!</p><p><strong>Mash:</strong> ...</p><p><strong>Fou:</strong> ...Fou</p><p><strong>Elisabeth:</strong> Impossible...Impossible! The venue is supposed to be filled with mobs of pathetic slaves!</p><p><strong>Elisabeth:</strong> With wildly waving glow-sticks, and fresh blood! It was supposed to be a special live event with tragedy and genocide!</p><hr><p><strong>Fujimaru 1:</strong> Um, about that...</p><hr><p><strong>Fujimaru 2:</strong> I am running out of funds!</p><hr><p><strong>Fou:</strong> Fou?</p><p><strong>Elisabeth:</strong> Huh? Is it possible the fans got the wrong start time?</p><p><strong>Elisabeth:</strong> Are they going to surprise me because today&#39;s my birthday? Are they?</p><p><strong>Elisabeth:</strong> Well, since it&#39;s not actually my birthday today, we could make it an anniversary, right?</p><p><strong>Elisabeth:</strong> Um, today marks the successful opening of my live tour. ...(Jotting that down)</p><p><strong>Elisabeth:</strong> That should do it. Okay, [\u2642 Puppy /\u2640\uFE0F Deerlet}!!Elly Live Tour 2017!! Let&#39;s get this party started!!</p><hr><p><strong>Fujimaru 1:</strong> Um, about that...</p><hr><p><strong>Fujimaru 2:</strong> Elly, you&#39;ve grown so much...</p><hr><p><strong>Mash:</strong> ...No, Senpai, look!</p><p><strong>Dr. Roman:</strong> It&#39;s definitely an enemy raid. Honestly, I&#39;m grateful.</p><p><strong>Elisabeth:</strong> Right! They definitely hate us! I kind of noticed that, you dummy!</p><p><strong>--BATTLE--:</strong></p><p><strong>Mash:</strong> There&#39;s more, Master! A large number of enemy reinforcements!</p><p><strong>Mash:</strong> It&#39;s like they&#39;ll do anything to stop her concert... Firmly resolved to crush it, to protect their wives and children...</p><p><strong>Mash:</strong> I am sensing the determination of a man, filling with grim resolve!</p><p><strong>Dr. Roman:</strong> Well, I&#39;d guess that Elisabeth giving a concert near the town would leave the townsfolk numb for a day.</p><p><strong>Dr. Roman:</strong> Wow, things are heating up! In a sense, today&#39;s concert is a jam-packed success!</p><p><strong>Fou:</strong> Fou!!</p><p><strong>Elisabeth:</strong> Not that I like the way things are heating up!</p><p><strong>Elisabeth:</strong> After all, if you&#39;re swooning over my stellar singing, doesn&#39;t that make this a huge win for me?</p><p><strong>Mash:</strong> It&#39;s that positive thinking that&#39;s at fault here. Singing shouldn&#39;t knock people out, Elisabeth!</p><p><strong>--BATTLE--:</strong></p><p><strong>Dr. Roman:</strong> They were casually mixed with others besides humans... Did the forest beasts also sense danger?</p><p><strong>Elisabeth:</strong> ...I won. I won, but, in winning the battle, I lost the concert...</p><p><strong>Elisabeth:</strong> Oh, if I can&#39;t be an idol, then I&#39;ll have to go back to being an ordinary Dragon Girl...</p><hr><p><strong>Fujimaru 1:</strong> Well, about that...</p><hr><p><strong>Fujimaru 2:</strong> Dragon Girls are pretty new.</p><hr><p><strong>Elisabeth:</strong> I suppose I belong in a dark dungeon, an imprisoned idol, unnoticed and ignored.</p><p><strong>Elisabeth:</strong> Doomed to silently rot away... Oh...Who made this era the way it is?</p><p><strong>Dr. Roman:</strong> Lev Lainur, I suppose.</p><p><strong>Fou:</strong> Fooou!</p><p><strong>Mash:</strong> U-Um, Elisabeth, don&#39;t get disappointed...</p><p><strong>Elisabeth:</strong> Spare me your sympathy... I... I just noticed...</p><p><strong>Elisabeth:</strong> \u2013You&#39;re on the right track, aren&#39;t you?</p><p><strong>Mash:</strong> Excuse me? Right...track?</p><p><strong>Elisabeth:</strong> Your character is [\u2642 Puppy /\u2640\uFE0F Deerlet}-like, so modest and genuine. You know...You might just work!</p><p><strong>Mash:</strong> Modest...Am I really?</p><p><strong>Elisabeth:</strong> Listen, are you interested in becoming an idol? You are, right? Of course you are! You&#39;ll do it!</p><p><strong>Elisabeth:</strong> Yes, this is it! An idol duo! All for me and one for me!</p><p><strong>Elisabeth:</strong> So, what do we call our unit? [\u2642 Puppy /\u2640\uFE0F Deerlet}! You have a good idea?</p><hr><p><strong>Fujimaru 1:</strong> Um, Elly\u2606Mash, maybe...</p><p><strong>Dr. Roman:</strong> You just ripped off Magi\u2606Mari, didn&#39;t you.</p><hr><p><strong>Fujimaru 2:</strong> How about Dra\u266AFresh Blood Shield Girl!</p><p><strong>Fou:</strong> Fou...</p><hr><p><strong>Elisabeth:</strong> That&#39;s kind of lame and I just don&#39;t feel it... Hm, since we&#39;re a lance and a shield, then...</p><p><strong>Elisabeth:</strong> Contradiction! That&#39;s it! We&#39;re full of contradictions! Contradiction\u2606Drastic!</p><p><strong>Fou:</strong> Fou, fou</p><hr><p><strong>Fujimaru 1:</strong> I-I&#39;m not sure...</p><hr><p><strong>Fujimaru 2:</strong> You know the word contradiction.</p><hr><p><strong>Elisabeth:</strong> Well, let&#39;s get started with our lessons! Let&#39;s go, Mash! We&#39;ll shine in the night sky together!</p><p><strong>Elisabeth:</strong> Let&#39;s aim to be Idol\u2606Servant stars!</p><p><strong>Mash:</strong> S-Senpai, please, do something...</p><hr><p><strong>Fujimaru 1:</strong> Um, right. Good luck...</p><hr><p><strong>Fujimaru 2:</strong> I&#39;ll do my best to back you up as a sponsor!</p><hr><p><strong>Mash:</strong> ?!?!</p>',108),a=[n];function i(g,h){return o(),e("div",null,a)}var l=t(s,[["render",i],["__file","Elisabeth B\xE1thory.html.vue"]]);export{l as default};
